if len(s.Columns) > 0 {
for idx, column := range s.Columns {
if idx > 0 {
builder.WriteByte(',')
}
builder.WriteQuoted(column)
}
}

for idx, expr := range exprs {
expr.Build(builder)
}

for idx, column := range columns {
field := Schema.LookUpField(column)
field.Set(db.Statement.ReflectValue, values[idx])
}
